    for (let i = 0; i < verticalAxis.length; i++) {
        for (let j = 0; j < horizontalAxis.length; j++) {
            board.push(<span>{verticalAxis[i]}, {horizontalAxis[j]}</span>)
        }
    }

    return <div id = "chessboard"></div>;
